import React from 'react';
import styled from 'styled-components';

import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';

import 'bootstrap/dist/css/bootstrap.min.css';

const List = (props) => {
  const teammate = [
    {
      teammateList: [
        'Lulu',
        'Sylas',
        'Hecarim',
        'Ornn',
        'Bard',
        'Zoe',
        'Aurelion Sol',
      ],
    },
    {
      teammateList: [
        'Ezreal',
        'Skarner',
        'Shen',
        'Twitch',
        'Varus',
        'Illaoi',
        'Ornn',
        'Xayah',
      ],
    },
  ];
  console.log(teammate[1].teammateList[0]);
  let mate = [];
  for (let i = 0; i < 8; i++) {
    mate.push(
      <li className='teammates'>
        <img
          src='https://rerollcdn.com/characters/Skin/7/Lulu.png'
          alt={teammate[0].teammateList[i]}
        />
        <div className='teammates-name'>{teammate[0].teammateList[i]}</div>
      </li>
    );
  }
  console.log(teammate.length, mate);
  return (
    <Wrapper>
      <TierGroup>
        <div className='team-info'>
          <div className='grade'>{props.data.grade}</div>
          <div className='team'>
            <div className='team-title'>{props.data.teamTitle}</div>
            <div className='team-style'>{props.data.teamStyle}</div>
          </div>
        </div>
        <ul className='team-comps'>{mate}</ul>
        <KeyboardArrowDownIcon
          style={{ width: 22, height: 22, color: 'rgba(255,255,255,0.5)' }}
        />
      </TierGroup>
      <TierGroupExpand>
        <div className='team-expand-detail'>
          <div className='team-expand-detail-comp '>
            <h6>Early Comp</h6>
            <ul>
              <li>
                <img
                  src='https://rerollcdn.com/characters/Base/Lulu.png'
                  alt=''
                />
              </li>
              <li>
                <img
                  src='https://rerollcdn.com/characters/Base/Lulu.png'
                  alt=''
                />
              </li>
              <li>
                <img
                  src='https://rerollcdn.com/characters/Base/Lulu.png'
                  alt=''
                />
              </li>
              <li>
                <img
                  src='https://rerollcdn.com/characters/Base/Lulu.png'
                  alt=''
                />
              </li>
              <li>
                <img
                  src='https://rerollcdn.com/characters/Base/Lulu.png'
                  alt=''
                />
              </li>
            </ul>
          </div>
          <div className='team-expand-detail-traits '>
            <h6>Traits</h6>
            <ul>
              <li></li>
            </ul>
          </div>
          <div className='team-expand-detail-item '>
            <h6>Carousel</h6>
            <div className='team-expand-detail-item-group'>
              <div className='part'>
                <img src='https://rerollcdn.com/items/RecurveBow.png' alt='' />
                <div className='main'>
                  <img
                    src='https://rerollcdn.com/items/GuinsoosRageblade.png'
                    alt=''
                  />
                </div>
              </div>
              <ArrowForwardIosIcon
                style={{
                  width: 15,
                  height: 15,
                  color: 'rgba(255,255,255,0.5)',
                }}
              />
              <div className='part'>
                <img src='https://rerollcdn.com/items/RecurveBow.png' alt='' />
                <div className='main'>
                  <img
                    src='https://rerollcdn.com/items/GuinsoosRageblade.png'
                    alt=''
                  />
                </div>
              </div>
              <ArrowForwardIosIcon
                style={{
                  width: 15,
                  height: 15,
                  color: 'rgba(255,255,255,0.5)',
                }}
              />
              <div className='part'>
                <img src='https://rerollcdn.com/items/RecurveBow.png' alt='' />
                <div className='main'>
                  <img
                    src='https://rerollcdn.com/items/GuinsoosRageblade.png'
                    alt=''
                  />
                </div>
              </div>
            </div>
          </div>
          <div className='team-expand-detail-options'>
            <h6>Options</h6>
            <div className='options-list'>
              <img
                src='https://rerollcdn.com/characters/Base/Lulu.png'
                alt=''
              />
              <ArrowForwardIosIcon
                style={{
                  width: 15,
                  height: 15,
                  color: 'rgba(255,255,255,0.5)',
                }}
              />
              <img
                src='https://rerollcdn.com/characters/Base/Lulu.png'
                alt=''
              />
              <img
                src='https://rerollcdn.com/characters/Base/Lulu.png'
                alt=''
              />
            </div>
